## Set up the list of URL paterns/paths for the server#from django.urls import pathfrom . import viewsapp_name = 'songs'urlpatterns = [        # http://127.0.0.1:8000/songs/    path('', views.IndexView.as_view(), name='index'),        # http://127.0.0.1:8000/songs/matches/4    path('matches/<index>/', views.MatchesView.as_view(), name='matches'),        # http://127.0.0.1:8000/songs/match1/    path('match1/', views.Match1View.as_view(), name='match1'),        # http://127.0.0.1:8000/songs/match2/    path('match2/', views.Match2View.as_view(), name='match2'),        # http://127.0.0.1:8000/songs/matchResults/    path('matchResults/', views.MatchResultsView.as_view(), name='matchResults'),]